import React, { Component } from "react";

class Features extends Component {
  state = {
    count: 0,
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  render() {
    return (
      <React.Fragment className="bg-primary">
        <div
          style={{
            fontSize: 40,
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
          className="bg-primary text-white"
        >
          House Price Predictor
        </div>
        {this.renderInputs()}
      </React.Fragment>
    );
  }

  renderHeader() {
    return (
      <div
        style={{
          fontSize: 40,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
        className="bg-primary text-white"
      >
        House Price Predictor
      </div>
    );
  }

  renderInputs() {
    return (
      <React.Fragment>
        <input
          type="text"
          placeholder="Tax Amount"
          name="tax"
          className="m-3"
        />
        <input
          type="text"
          placeholder="Number of Bathrooms"
          name="bathrooms"
          className="m-3"
        />
        <input
          type="text"
          placeholder="Number of Bedrooms"
          name="bedrooms"
          className="m-3"
        />
        <input
          type="text"
          placeholder="Year Built"
          name="year"
          className="m-3"
        />
        <input type="text" placeholder="Area" name="area" className="m-3" />
      </React.Fragment>
    );
  }
}

export default Features;
